import BaseService from './baseService';
import API from '../config/rest';

const getAllData = () => {
    return BaseService.get(API.DATA);
}

const getDataId = () => {
    return BaseService.get(API.FILEDATA());
}

const appServices = {
    getAllData,
    getDataId
}

export default appServices;
